import './project-tab-content.scss';

import React from 'react';
import Modal from 'react-modal';

const ProjectTabContent = ({ isOpen }) => (
    <Modal isOpen={isOpen}>
        <article className="project-tab-content">

        </article>
    </Modal>
);

export default ProjectTabContent;
